[[package]]
name = "blinker"
version = "1.7.0"
requires_python = ">=3.8"
summary = "Fast, simple object-to-object and broadcast signaling"

[[package]]
name = "click"
version = "8.1.7"
requires_python = ">=3.7"
summary = "Composable command line interface toolkit"
dependencies = [
    "colorama; platform_system == \"Windows\"",
]

[[package]]
name = "colorama"
version = "0.4.6"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,!=3.4.*,!=3.5.*,!=3.6.*,>=2.7"
summary = "Cross-platform colored terminal text."

[[package]]
name = "flask"
version = "3.0.2"
requires_python = ">=3.8"
summary = "A simple framework for building complex web applications."
dependencies = [
    "Jinja2>=3.1.2",
    "Werkzeug>=3.0.0",
    "blinker>=1.6.2",
    "click>=8.1.3",
    "itsdangerous>=2.1.2",
]

[[package]]
name = "flask-httpauth"
version = "4.8.0"
summary = "HTTP authentication for Flask routes"
dependencies = [
    "flask",
]

[[package]]
name = "flask-wtf"
version = "1.2.1"
requires_python = ">=3.8"
summary = "Form rendering, validation, and CSRF protection for Flask with WTForms."
dependencies = [
    "flask",
    "itsdangerous",
    "wtforms",
]

[[package]]
name = "greenlet"
version = "3.0.3"
requires_python = ">=3.7"
summary = "Lightweight in-process concurrent programming"

[[package]]
name = "itsdangerous"
version = "2.1.2"
requires_python = ">=3.7"
summary = "Safely pass data to untrusted environments and back."

[[package]]
name = "jinja2"
version = "3.1.3"
requires_python = ">=3.7"
summary = "A very fast and expressive template engine."
dependencies = [
    "MarkupSafe>=2.0",
]

[[package]]
name = "markupsafe"
version = "2.1.5"
requires_python = ">=3.7"
summary = "Safely add untrusted strings to HTML/XML markup."

[[package]]
name = "sqlalchemy"
version = "2.0.27"
requires_python = ">=3.7"
summary = "Database Abstraction Library"
dependencies = [
    "greenlet!=0.4.17; platform_machine == \"aarch64\" or (platform_machine == \"ppc64le\" or (platform_machine == \"x86_64\" or (platform_machine == \"amd64\" or (platform_machine == \"AMD64\" or (platform_machine == \"win32\" or platform_machine == \"WIN32\")))))",
    "typing-extensions>=4.6.0",
]

[[package]]
name = "typing-extensions"
version = "4.9.0"
requires_python = ">=3.8"
summary = "Backported and Experimental Type Hints for Python 3.8+"

[[package]]
name = "werkzeug"
version = "3.0.1"
requires_python = ">=3.8"
summary = "The comprehensive WSGI web application library."
dependencies = [
    "MarkupSafe>=2.1.1",
]

[[package]]
name = "wtforms"
version = "3.1.2"
requires_python = ">=3.8"
summary = "Form validation and rendering for Python web development."
dependencies = [
    "markupsafe",
]

